import React from 'react';

const pages = Array.from(Array(10).keys()).map(x => x+1);

const PaginationBlock = () => {

    return (
        <div className="pagination">
            {pages.map((page) =>
                <Pagination.Item key={page} active={page === active}>
                    {page}
                </Pagination.Item>)}
        </div>
    )
};

export default PaginationBlock;
